import axiosClient from "./axiosClient";

export const signup = (user) => {
    console.log(user);
    const url = `/signup`;
    return axiosClient.post(url, user);
};
export const signin = (user) => {
    const url = `/signin`;
    return axiosClient.post(url, user);
};

